import React from 'react'
import Header from 'Homepage/Header'
function Blogweb() {
  return (
    <div>
      <Header />
      <div>
        <h1 className="text-center text-3xl pt-10">What to read next</h1>
      </div>
    </div>
  )
}

export default Blogweb
